import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "15px 40px",
        backgroundColor: "rgba(0,0,0,0.7)", // ✅ Transparent dark
        position: "fixed",
        width: "100%",
        top: 0,
        left: 0,
        zIndex: 1000,
      }}
    >
      <h2 style={{ color: "white", fontSize: "28px", fontWeight: "bold", margin: 0 }}>
        Pizzalicious
      </h2>
      <div
        style={{
          display: "flex",
          gap: "25px",
        }}
      >
        <Link to="/" style={{ color: "white", fontSize: "18px", textDecoration: "none" }}>
          Home
        </Link>
        <Link to="/build-pizza" style={{ color: "white", fontSize: "18px", textDecoration: "none" }}>
          Build Pizza
        </Link>
        <Link to="/my-orders" style={{ color: "white", fontSize: "18px", textDecoration: "none" }}>
          My Orders
        </Link>
        <Link to="/login" style={{ color: "white", fontSize: "18px", textDecoration: "none" }}>
          Login
        </Link>
      </div>
    </nav>
  );
}
